Normalmente são as últimas palavras dos pilotos antes de salvarem suas vidas e perderem um aparelho de milhões de dólares. ("Se vão os anéis, mas ficam os dedos!")

O Assento ejetor, é um sistema de emergência, normalmente um componente instalado em aviões militares, que tem por objetivo salvar o piloto (ou pilotos), no caso de iminente perigo de queda do avião, seja por mau funcionamento deste, ou por ataque aéreo em que aquele é danificado.

O assento é propulsionado por uma carga explosiva, ou por um motor a foguete, que impulsiona a cadeira, e o piloto, para fora do cockpit, accionando um pára-quedas, para uma descida em segurança.

